import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Form, FormGroup, FormLabel, FormControl, FormText, Container, Row, Col, Button } from "react-bootstrap"

export default () => {
  return (
    // <div className="component first-component">
    //   <div >
    <Container style={{ alignContent: 'center', justifyContent: 'center' }}>
      <Row>
        <h1>แล้วคุณหล่ะ?</h1>
      </Row>
      <Row>
        <Form>
          <Form.Group controlId="formBasicFood" style={{}}>
            <Form.Label size="lg">ค่าอาหาร</Form.Label>
            <Form.Control size="lg" type="number" placeholder="ค่าอาหารต่อวัน" />
            <Form.Text className="text-muted">
              We'll never share your email with anyone else.
          </Form.Text>
          </Form.Group>
          <Form.Group controlId="formBasicHome">
            <Form.Label>ค่าเช่าบ้าน</Form.Label>
            <Form.Control size="lg" type="number" placeholder="ค่าเช่าบ้านต่อเดือน" />
          </Form.Group>
          <Button variant="primary" type="submit">
            Submit
          </Button>
        </Form>
      </Row>
    </Container >
    //   </div>
    // </div>
  );
};
